import React from "react";
import "./About.scss";
import mongodb from "../../assets/icons/mongodb.png";
import express from "../../assets/icons/express.svg";
import react from "../../assets/icons/react.svg";
import nodejs from "../../assets/icons/nodejs.png";
import bootStrap from "../../assets/icons/bootstrap.svg";
import sass from "../../assets/icons/sass.svg";
import stripe from "../../assets/icons/stripe.svg";
import javascript from "../../assets/icons/javascript.svg";
import { Container, Row, Col, Image } from "react-bootstrap";

function About() {
  return (
    <section className="about">
      <h1 className="about__title">
        This application was built using Mern stack
      </h1>
      <Container>
        <Row>
          <Col xs={6} md={4}>
            <Image className="about__icon" src={mongodb} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image className="about__icon" src={express} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image className="about__icon" src={react} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image className="about__icon" src={nodejs} rounded />
          </Col>
        </Row>
        <Row>
          <Col xs={6} md={4}>
            <Image className="about__icon" src={bootStrap} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image className="about__icon" src={sass} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image className="about__icon" src={stripe} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image className="about__icon" src={javascript} rounded />
          </Col>
        </Row>
      </Container>
    </section>
  );
}

export default About;
